                                        placeholder=" पिता का नाम दर्ज करें" value={fatherName} onChange={(event) => { setFatherName(event.target.value) }} /> </div>
                                </div>
                                <div className="col-md-4"> <label htmlFor="validationCustom02" className="form-label"> Mother's Name <span
